(28, 29, 'SWECHA\'S FREEDOM FEST ON FEB 1 & 2, 2019', '<h1>Swecha Freedom Fest at KL University, Guntur<br />\r\nAn opportunity to explore the new age technologies in Free and Open Source Domain which are the current Industrial practices</h1>\r\n\r\n<h1>8 Workshops on tools varied from IoT, ML, Web, App Dev, Image Processing etc&nbsp;<br />\r\nTechnical and Non Technical Events</h1>\r\n\r\n<h1>February 1,2</h1>\r\n\r\n<h1>Registration Fee: 200 Rs for access to all events</h1>\r\n\r\n<h1>Register Soon and spread the word: &nbsp;<a href=\"http://freedomfest.in/\">http://freedomfest.in/</a></h1>\r\n\r\n<h1>Workshops :(Highlight the workshops which are particular for CSE nd ECE)</h1>\r\n\r\n<h1>1) IOT<br />\r\n&nbsp;We hear iot is about collecting data from sensors, youll learn how to visualize the data and plotting graphs by creating your own cloud based dashboard</h1>\r\n\r\n<h1>2)web ui with react js:<br />\r\nWant to learn how the best web interfaces like Facebook, Instagram are developed. They use React which is a Java script library . Youll get introduced to it.</h1>\r\n\r\n<h1>3)mobile app development using flutter :<br />\r\n&nbsp; Flutter is developed by google for building mobile apps on Android and IOS. It provides Attractive display components.&nbsp;</h1>\r\n\r\n<h1>4)machine learning :&nbsp;<br />\r\n&nbsp; ML is the buzz word we hear wherever we go. We need not introduce about that. get introduced to lot of tools like tensorflow, pytorch etc &nbsp;</h1>\r\n\r\n<h1>5) Image Proc OpenCV<br />\r\nWe all are interested about age tagging, face unlock, beautify features in our mobile phone. Learn how to develop such stuff using OpenCV.</h1>\r\n\r\n<h1>5)Inkscape :<br />\r\n&nbsp; &nbsp;It is a tool for designing variety of graphics such as icons,logos,posters</h1>\r\n\r\n<h1>6)emerging practices in industry :<br />\r\nExperience the project work flow model in industry in this gamification and interactive session.&nbsp;</h1>\r\n\r\n<h1>7)git version control :<br 