(54, 43, 'RE-CONDUCTION OF ONLINE EXAMS CCS COURSE (ENGLISH)', '<h2>ABSENTEES LISTS OF ALL ONLINE EXAMS WERE FORWARDED TO YOUR RESPECTIVE DEPARTMENTS (HoD&#39;S) AND FROM THERE, THEY WILL REACH THE DEAN ACADEMICS OFFICE AND IF YOU (STUDENT) HAVE PROVIDED ANY VALID PROOF FOR YOUR ABSENCE, AND IF APPROVED AT DEAN ACADEMICS OFFICE, YOU MAY BE PERMITTED TO TAKE YOUR EXAM, FOR WHICH YOU WERE ABSENT.</h2>\r\n\r\n<h2>YOU MAY APPROACH YOUR RESPECTIVE DEPARTMENTS FOR FURTHER CLARIFICATIONS.</h2>\r\n', 'alert', '2019-04-02 16:16:01', '5ca38ac124e804.00163573.png'),
(55, 727, 'CLAD CERTIFICATE COURSE(CC) EXAMINATION', '<p>As the tension of the examination is raising due to the hectic schedule of exams timetable, wondering how we will perform many of us have missed the materials of CLAD. by reading this it may have dawned that you didn&#39;t prepare for it, don&#39;t worry just chill. take a look on the link down below in order to download the materials for the CLAD.</p>\r\n\r\n<p><a href=\"https://educationhyper.blogspot.com/p/blog-page.html\" target=\"_blank\">CLICK THIS LINK TO VIEW/DOWNLOAD CLAD MATERIALS</a></p>\r\n', 'alert', '2019-04-04 04:32:09', '5ca588c98c1512.01406349.jpg'),
