(66, 36, 'Idealabs Global Innovation Immersion Programme (IGIIP)', '<p>We are delighted to announce Idealabs Global Innovation Immersion Programme (IGIIP) , a two week internship including one week immersion tour to &quot;South Korea&quot; - World&rsquo;s No.1 country in Innovation Index by Bloomberg for the fifth consecutive year.</p>\r\n\r\n<p>Experience the birth place of the most iconic brands like LG, Samsung, Hyundai, LG to some of the most exciting startups in Blockchain, AI, IoT and electrical vehicles.</p>\r\n\r\n<p>Program at South Korea includes:</p>\r\n\r\n<p>&bull; &nbsp;&nbsp;&nbsp; &nbsp;Interaction with Korea&rsquo;s start-up ecosystem<br />\r\n&bull;&nbsp;&nbsp; &nbsp; &nbsp; Industry visits<br />\r\n&bull;&nbsp;&nbsp; &nbsp; &nbsp; Ideation contest and product pitch by students and startups to Korean mentors &amp; investors,<br />\r\n&bull;&nbsp;&nbsp; &nbsp; &nbsp; Exploring market opportunity and potential partners.</p>\r\n\r\n<p>Students can avail aicte grant of upto RS. 1.0 lakh</p>\r\n\r\n<p>This is open for 10-15 students only. They have to apply on our website and will be shortlisted.</p>\r\n\r\n<p>The tour is planned in July third week 22July &nbsp;onwards. Visa processing and other formalities will take 2 weeks. Last date of registration is june10. Our shortlisting will complete by june15.</p>\r\n\r\n<p>It&#39;s a two week programme with one week in India and one week in South korea.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For Details:&nbsp;http://www.idealabsftv.in/igiip/&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(or) Reach out to Udayan Bakshi , VP- Academic Innovation, Idealabs FutureTech Ventures.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Phone: 90300 06060,&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; E-mail: info@idealabsftv.in</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'alert', '2019-05-29 14:11:40', '5cee931cd2dc99.76121205.jpeg'),
(67, 727, 'Campus Commune', '<p>The Registrations for TCS National Qualifier Test (TNQT) is about to start in a day or two. We could guess that you already have few queries on TNQT. We have come up with a blog on Campus Commune on TNQT sample questions so that you can get a feeler of what this aptitude test is all about.<br />\r\n<br />\r\nVisit the link to know more : <a href=\"https://on.tcs.com/2HOAaen\" target=\"_blank\">https://on.tcs.com/2HOAaen</a><br />\r\n<br />\r\nWe welcome your thoughts &amp; share the questions in comments session of the blog.<br />\r\n<br />\r\nThanks &amp; Regards.<br />\r\nCampus Commune Team<br />\r\nTATA Consultancy Services</p>\r\n', 'alert', '2019-05-30 09:59:59', '5cefa99f50e737.61448904.jpeg'),
