(4, 28, 'Marketing: the basics', '&lt;h3&gt;Marketing is the process of planning and executing the conception, pricing, promotion and distribution of your ideas, goods or services to satisfy the needs of individual consumers or organisations.&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Every business needs to successfully market their products and services. Marketing is a critical tool for establishing awareness, attracting new customers and building lasting relationships. When done effectively, marketing can help you increase sales and establish your competitive advantage.&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Today&amp;#39;s customers are spoilt for choice. Marketing uses communication and advertising tactics to persuade customers that your brand, including your products and services, are exactly what they need. Even though you are marketing your brand, every aspect of your marketing strategy should focus on satisfying the current and future needs of your customers.&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Your approach to marketing will inform your sales techniques, so communication and collaboration within your team is critical, and everyone in your organisation should have some ownership of your marketing campaigns.&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Marketing is a crucial aspect of your business and requires research, time, planning, and appropriate budget allocations. This guide will help you understand the basics of marketing.&lt;/h3&gt;\r\n', '#marketing #basics #networking', '5c936473a82983.44213028.jpg', '2019-03-21 10:16:19'),
(6, 43, 'Chess for beginners', '&lt;h2&gt;Chess is a two player board game&amp;nbsp;with its roots tracing back 1500 years in India with its old name as Chaturanga / Chatranj. Unlike other board games which are based on luck, chess is a very much strategic and tactics filled game replicating the war field of ancient times.&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;a href=&quot;https://chessworld4u.blogspot.com/2018/12/what-is-chess-and-where-to-start.html&quot;&gt;Click here to view my blog&lt;/a&gt;&lt;/h2&gt;\r\n', ' ', '5ca0bc844118e0.42615613.png', '2019-03-31 13:11:32'),
(7, 43, 'Indian game variation', '&lt;h2&gt;In the game of chess, Indian Defence or Indian Game is a broad term for a group of openings characterised by the moves: 1.&amp;nbsp;&lt;strong&gt;d4&lt;/strong&gt;&amp;nbsp;Nf6. They are all to varying degrees&lt;strong&gt;hypermodern&lt;/strong&gt;&amp;nbsp;defences, where Black invites White to establish an imposing presence in the centre with the plan of undermining and ultimately destroying it.&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;a href=&quot;https://chessworld4u.blogspot.com/2019/03/indian-game.html&quot; target=&quot;_blank&quot;&gt;CLICK HERE TO VIEW&lt;/a&gt;&lt;/h2&gt;\r\n', '#chess, #Indiangame, #Indianvariation', '5ca0be74c5c164.20798797.png', '2019-03-31 13:19:48');
