INSERT INTO `clubs` (`id`, `club_name`, `description`, `logo`) VALUES
(10, 'PULSE', '', 'https://4.bp.blogspot.com/-LO9fggXh-pE/XEF5RmJqSPI/AAAAAAAASiY/Y9jXHFieAmQViHiQfM3WFit9psIIlHFugCLcBGAs/s1600/pulse.jpg'),
(11, 'KLUGLUG', NULL, 'https://avatars2.githubusercontent.com/u/24322294?s=200&v=4'),
(12, 'BLOCKCHAIN CLUB', 'This is Block-Chain developers club connecting Block chain Developers around and building solutions to the real world problems. ', 'https://2.bp.blogspot.com/-lj_5uLMOvnM/XMGA5WxZcQI/AAAAAAAAVsA/FgPfYoPVN4Qi7p56ULJheRQnLOhgGwaZACLcBGAs/s1600/bitcoin.png'),
(13, 'E CLUB', 'The Entrepreneurship Club aims to provide a conduit by which students can access entrepreneurial resources, network with community entrepreneurs, and share ideas. The club is dedicated to furthering understanding about new and small businesses.', 'https://2.bp.blogspot.com/-hXwx-C5E7Kg/XMGA5RheJZI/AAAAAAAAVr8/oQQMBtenztk9qKD9MqDd3JHGxHV4zbI1QCLcBGAs/s1600/entrepreneur.png'),
(14, 'CEA', '<hr />\r\n<span style=\"font-size: x-large;\"><b>Vision </b></span>\r\n<br />\r\nTo imbibe social consciousness into the student community and thus lay a foundation for a more selfless society.\r\n<br />\r\n<br />\r\n<span style=\"font-size: x-large;\"><b>Mission </b></span>\r\n<br />\r\nTo organize philanthropic activities with special concentration on welfare of children, youth,women and under-served rural and urban population.\r\nTo encourage environment and sustainability consciousness with the help of public awareness sessions and implementation of waste management, solar power generation, etc.\r\nTo provide engineering solutions for persistent social problems and for profitability in agricultural sector.\r\nTo induce the concept of inclusive growth in the student community by organizing video presentations, literature circulations (newsletters) etc. and fund raising activities like stage performances', 'https://1.bp.blogspot.com/-sHngPcrHG1w/XDB6nIk5ggI/AAAAAAAADpQ/Y-82SUqhPwI90pb7XVhVaagkJOYhWN1rQCLcBGAs/s1600/KLEF%2BCEA.png'),
(21, 'Aastha Club', 'The Astha club is an organization initiated by student themselves which aims to change the society. Its main motto is to help needy people like students studying in government schools, orphans, physically challenged people, and those affected by natural disasters.\r\n\"The fruit of faith is love, and the fruit of  love is service.\"\r\n', ''),
(22, 'Aarohana Club ', 'Aarohana club is a trekking club which helps in building up self-confidence and team work in students. This club crafts situations which help the students understand the importance of assisting each other in intricate situations and aids students people manage ups and downs of their life by making them indulge in tasks where they keep learning.', ''),
(23, 'Abhinaya Club ', 'The club devotes itself in working for restoring the cultural heritage. ABHINAYA aims at leading the world to the new and improved cultural society again into the days, back when ABHINAYAM was the most vital mode of expression, and when ABHINAYAM was the language of communication.', ''),
(24, 'Maya Club ', 'To create creative heads who excel in making (create/direct/edit) media (short films, documentaries, posters etc) which can enlighten the world as to what is happening or what has to happen.\r\nTo creatively improvise the movie making skills in interested students technically and also curricular by conducting events, activities and providing chances to apply their knowledge practically in real world.\r\n', ''),
(25, 'Narthana Club ', 'Narthana, the dance club of KLUSO, is a platform that imbibes the intricate movements of classical dance with the narrative theatrical elements of drama. It is a showcase where individuals can develop their dancing skills. It promotes culture with entertainment and lets people show case their talent on a grand platform. Augments the ability to appeal to large audiences by adapting to the new and fast changing world we live in, without changing the basic essence of dance.', ''),
(26, 'Prakruthi Club ', 'This is an environmental club completely dedicated for protection of environment and to create awareness among people about the importance of environment. PRAKRUTHI club tries to project the threats to the environment because of human activities which are endangering the species and disturbing the bio-diversity and to create environmental awareness among the students before it’s too late. To create awareness among people and students about environmental protection and how to live eco-friendly. This helps us to protect our future generations to have healthy living.', ''),
(27, 'Samskruthi Club ', '\"A civilization is a heritage of beliefs, customs, and knowledge slowly accumulated in the course of centuries, elements difficult at times to justify by logic, but justifying themselves as paths when they lead somewhere, since they open up for man his inner distance.\" This club spreads the greatness of heritage and social values of our country among the people.  This club strives to promote Indian culture and heritage among the students and enhances the  sense of religious tolerance and harmony.', ''),
(28, 'Yantrana Club', 'Necessity is the mother of INVENTION and INNOVATION is the mother of INVENTION. Every innovative idea led to an impossible invention which proved impossible was not really that hard to achieve. These have now become the part and parcel of our kith and kin. This technical club is a yonder destiny in the quest of perfection where we leave no stone unturned and no second unspent.', ''),
(29, 'Vachas Club ', 'To create a thought provoking environment among the members of the club that would broaden the horizons in the numerous realms of their lives letting them instil the leadership qualities thus building dynamism in each individual.\r\nMission:\r\n?	To elicit the latent talent of every member of the club\r\n?	To induce, in the members, an urge to make their mark in the society.\r\n?	To introduce to them the plethora of benefits in all-round personality development.\r\n?	To train them to take a stand on several challenges be it social, political or ethical.\r\n', ''),
(30, 'Swara Club ', 'The universal octet \"Sa Re Ga Ma Pa Da Ni Sa\" that ushers inspiration to every single sound reticently; this is what swara stands for in KLUSO. It has the auteur to create and conquer every miraculous voice that is born to sing with life that rejuvenates every ear that listens and every heart that feels.', ''),
(31, 'Swara Club ', 'Technically referring to notes in an octave, Swara is the foundation of music. Cleverly choosing it as our label we, the Swara club profoundly put our efforts to lay the flotation for all the music lovers to showcase their talent. Being one of the many cultural clubs of KLUSO, Swara club has gained its own substance by being the platform for all the music enthusiasts to improve their vocal and instrumental abilities in music. Being offered all the requisite equipment we have appreciably expanded our club to nearly 50 members of all genre. ', '');
