(2, 'MACHINE LEARNING', 2016, 4, 'ece', 1, NULL, NULL, 'https://www.youtube.com/embed/D7t-Dmw02lk', '2019-07-07 14:38:39', 'Bayesian networks are a type of probabilistic graphical model that uses Bayesian inference for probability computations. Bayesian networks aim to model conditional dependence, and therefore causation, by representing conditional dependence by edges in a directed graph', 'BAYESIAN NETWORKS', 'V N S S TEJA', 'https://media.licdn.com/dms/image/C5603AQG9o-zMLPwicQ/profile-displayphoto-shrink_800_800/0?e=1568246400&v=beta&t=uFZ5F7goJvvNBy5rPdFVseeKp0ytFI_8ehJKzPS3-lE', 0);
