(35, 151, '10 Best Open Source Web Testing Tool', '<h2>What is&nbsp;<strong>Web Testing</strong>?&nbsp;<strong>Web testing</strong>is a software&nbsp;<strong>testing</strong>&nbsp;practice to&nbsp;<strong>test</strong>&nbsp;the websites or&nbsp;<strong>web</strong>applications for potential bugs. It&rsquo;s a complete&nbsp;<strong>testing</strong>&nbsp;of&nbsp;<strong>web</strong>-based applications before making live.</h2>\n\n<h2><a href=\"https://www.testingexcellence.com/10-best-open-source-web-testing-tool/\">Click Here to View</a></h2>\n', '2019-03-10 09:01:42', 'udemy.png', 34),
(39, 151, 'Embedded Systems | Udacity', '<h2><a href=\"https://in.udacity.com/course/embedded-systems--ud169\">Embedded Systems | Udacity</a>      \n<p><a href=\"https://in.udacity.com/course/embedded-systems--ud169\"><em>CLICK HERE TO ENROLL</em></a></p>\n</h2>\n\n<h2>About this Course</h2>\n\n<h2>In the 21st century, embedded systems are the systems of future with cellular phones, smart-phones, tablets becoming the dominant platforms for computing and communication. The ubiquity of information and the associated need for the computation that accompanies it is driving this revolution only to be accelerated by the new paradigms such as the Internet-of-Things (IoT). These platforms are clearly very different in terms of their processing requirements which are very unique: real-time needs, high performance but at low energy, compact-code and data segments, and most importantly ever changing software stack. Such unique requirements have led to a complete redesign and reinvention of the both hardware and the software stack from ground up, for example, brand new processors such as ARM, DSPs, network processors were invented all the way up to new virtual machines such as Dalvik, new operating systems such as Android and new programming models and compiler optimizations.</h2>\n\n<h2>Why Take This Course</h2>\n\n<h2>The goal of this course is to take a holistic view of the embedded system stack with a focus on processor architectures, instruction sets and the associated advanced compiler optimizations that take advantage of the same.<em>&nbsp;</em></h2>\n\n<p>&nbsp;</p>\n', '2019-03-11 05:03:38', 'udacity.png', 166),
